import {
    createAction
}
from "../functions/createAction";

const onAddChar = createAction({
    name: "ON_ADD_CHAR",
    payload: [
        "char"
    ]
});

const onAddCMath = createAction({
    name: "ON_ADD_MATH",
    payload: [
        "value"
    ]
});

export {
    onAddChar
}
